import React from 'react';
import Logo from '../data/logo.png';

const SimplePage = () => {
  return (
    <div className='mx-10'>
      <img src={Logo} />
      <ul>
      <li className="text-white">Item 1</li>
        <li className="text-wh">Item 2</li>
        <li className="text-black">Item 3</li>
        <li className="text-black">Item 4</li>
        <li className="text-black">Item 5</li>
      </ul>
    </div>
  );
};

export default SimplePage;
